  false,\n\t\"url\": null,\n\t\"notes\": \"This collaborative project will provide
  biologists and managers along the Atlantic coast with tools to predict effects of
  accelerating sea-level rise on the distribution of piping plover breeding habitat,
  test those predictions, and feed results back into the modeling framework to improve
  predictive capabilities. Immediate model results will be used to inform a coast-wide
  assessment of threats from sea-level rise and related habitat conservation recommendations
  that can be implemented by land managers and inform recommendations to regulators.
  Case studies incorporating resilience of piping plover habitat into management plans
  for specific locations will demonstrate potential applications.\",\n\t\"owner_org\":
